import React, { useState, useEffect } from 'react';
import { useParams } from "react-router-dom";
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import axios from 'axios';


const DeleteProducts= (props) => {
    const { id } = useParams();
    const [usr, setUsr] = useState();




    useEffect(() => {
        axios.get(`https://fakestoreapi.com/products/${id}`).then(result => {
            setUsr(result.data);
        })
    }, [id]);

    const handleRemovePost = () => {
        axios.delete(`https://fakestoreapi.com/products/${id}`).then(result => {
            props.history.push("/products");
        })
    }

    return (




 <Paper sx={{ p: 2, margin: 'auto', maxWidth: 1000, flexGrow: 1 }}>
          <Typography variant="h2" component="h1" gutterBottom>


      </Typography>

      <Grid container spacing={2}>

        <Grid item xs={12} sm container>
          <Grid item xs container direction="column" spacing={2}>
            <Grid item xs>
              <Typography gutterBottom variant="subtitle1" component="div">


              </Typography>


              <Typography gutterBottom variant="subtitle1" component="div">
              {/* {usr?.email} */}

              </Typography>


              <Typography gutterBottom variant="subtitle1" component="div">


              </Typography>

              <Typography gutterBottom variant="subtitle1" component="div">

              </Typography>
            </Grid>
            <div className="form-group col">
                <Link to="/products" className="btn btn-outline-warning">
                    <i className="fa fa-arrow-left"></i>    Annuler
                </Link>
                <button  style={{float:'right'}} onClick={handleRemovePost} className="btn btn-outline-danger">
                    Supprimer <i className="fa fa-trash"></i>
                </button>
            </div>
          </Grid>

        </Grid>
      </Grid>
    </Paper>
    );
}

export default DeleteProducts;
